import React, { useEffect, useState } from "react";

function Success() {
  const [session, setSession] = useState(null);

  useEffect(() => {
    // Extract session ID from the URL
    const urlParams = new URLSearchParams(window.location.search);
    const sessionId = urlParams.get("session_id");

    // Optionally, you can make a request to your server to retrieve more information about the session
    // For simplicity, this example assumes you have the session information available in the frontend
    setSession({ id: sessionId });
  }, []);

  return (
    <>
      <div>
        <h1>Payment Successful</h1>
        {session && <p>Session ID: {session.id}</p>}
        {/* Display other success information as needed */}
      </div>
    </>
  );
}

export default Success;
